//header-begin
uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iDepthTexture;
uniform sampler2D iSceneTexture;
uniform float iCameraNear;
uniform float iCameraFar;
uniform sampler2D iTexture0;
uniform sampler2D iTexture1;
//header-end
varying vec2 fUV;
//Fill the iPass0 texture with Vignette shader.
void main() {
    float offset = 1.0;
    float darkness = 1.0;
    vec4 backColor = vec4(0.203,0.293,0.485,1.000);
    vec2 uv = ( fUV - vec2(0.5,0.5) ) * vec2( offset );
    gl_FragColor = vec4( mix( backColor.rgb, vec3( 1.0 - darkness ), dot( uv, uv ) ), backColor.a );
}

