materials.fragmentShader:
//header-begin
uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iDepthTexture;
uniform sampler2D iSceneTexture;
uniform float iCameraNear;
uniform float iCameraFar;
uniform sampler2D iTexture0;
uniform sampler2D iTexture1;
uniform sampler2D iPass0;
uniform sampler2D iPass1;
//header-end
varying vec3 fPosition;
varying vec3 fNormal;
varying vec2 fUV;

vec3 rim(vec3 color, float start, float end, float coef)
{
  vec3 normal = normalize(fNormal);
  vec3 eye = normalize(cameraPosition- fPosition);
  float rim = smoothstep(start, end, 1.0 - dot(normal, eye));
  return clamp(rim, 0.0, 1.0) * coef * color;
}


void main()
{
    vec3 rimColor = rim(vec3(0.764,1.000,0.857),0.360,1.144,1.816);
    vec3 baseColor = fNormal * sin(iTime * 3.0);
    vec4 color = vec4(rimColor + baseColor,1.0);

    float cutout = texture2D(iTexture0, fUV).r;

    float level = sin(iTime*3.0) * 0.5 + 0.4;
    float edge = 0.092;
    if (cutout < level){
        discard;
    }
    vec4 edgeColor1 = vec4(1.000,0.969,0.195,1.000);
    vec4 edgeColor2 = vec4(0.110,0.019,0.084,1.000);
    if(cutout < color.a && cutout < level + edge){
        color = mix(edgeColor1, edgeColor2, (cutout-level)/edge );
    }
    gl_FragColor = color;
}

